from collections import Counter


class Solution:
    def findSubstring(self, s, words):
        l_max = len(words)
        l = len(words[0])
        index = []
        word_dict = {}
        count_dict = {}
        word_s = set(words)

        for w in words:
            if w in word_dict:
                word_dict[w] += 1
            else:
                word_dict[w] = 1
                count_dict[w] = 0

        for i in range(len(s)):
            for key in count_dict.keys():
                count_dict[key] = 0

            if s[i:i+l] in word_s and s[i+l_max * l - l:i+l_max * l] in word_s and len(s[i+l_max * l - l:i+l_max * l]) == l:
                count_dict[s[i:i+l]] += 1
                if l_max != 1:
                    count_dict[s[i+l_max * l - l:i+l_max * l]] += 1

                if count_dict == word_dict:
                    index.append(i)
                    continue
                for j in range(1, l_max - 1):
                    if s[i+l*j:i+l*j+l] in word_s:
                        count_dict[s[i+l*j:i+l*j+l]] += 1
                        if count_dict == word_dict:
                            index.append(i)
                            continue
                    else:
                        break
        return index

    def findSubstring2(self, s, words):
        l_max = len(words)
        l = len(words[0])
        index = []
        word_s = set(words)
        word_dict = {}
        count_dict = {}

        for w in words:
            if w in word_dict:
                word_dict[w] += 1
            else:
                word_dict[w] = 1

        for i in range(len(s)):
            for key in word_dict.keys():
                count_dict[key] = 0
            j = 0
            k = l_max
            while j < k:
                if s[i+l*j:i+l*j+l] not in word_s or s[i+k*l-l:i+k*l] not in word_s:
                    break
                else:
                    count_dict[s[i+l*j:i+l*j+l]] += 1
                    if j != k - 1:
                        count_dict[s[i+k*l-l:i+k*l]] += 1
                    if count_dict[s[i+l*j:i+l*j+l]] > word_dict[s[i+l*j:i+l*j+l]]:
                        break
                    j += 1
                    k -= 1
            if count_dict == word_dict:
                index.append(i)
        return index

    def findSubstring3(self, s, words):
        l_max = len(words)
        l = len(words[0])
        index = []

        for i in range(len(s)):
            j = 0
            k = l_max
            words_s = words
            while j < k:
                if s[i+l*j:i+l*j+l] not in words_s or s[i+k*l-l:i+k*l] not in words_s:
                    break
                else:
                    words_s.remove(s[i+l*j:i+l*j+l])
                    if j != k - 1:
                        words_s.remove(s[i+k*l-l:i+k*l] )
            if len(words_s) == 0:
                index.append(i)

    def findSubstring4(self, s, words):
        l_max = len(words)
        l = len(words[0])
        index = []
        word_s = set(words)
        word_dict = {}
        count_dict = {}

        for w in words:
            if w in word_dict:
                word_dict[w] += 1
            else:
                word_dict[w] = 1

        for i in range(len(s)):
            if i in index:
                continue
            count = 0
            j = 0
            k = l_max - 1
            for key in word_dict.keys():
                count_dict[key] = 0

            while j <= k:
                if s[i+l*j:i+l*j+l] not in word_s or s[i+l*k:i+l*k+l] not in word_s:
                    break
                else:
                    count_dict[s[i+l*j:i+l*j+l]] += 1
                    if count_dict[s[i+l*j:i+l*j+l]] > word_dict[s[i+l*j:i+l*j+l]]:
                        break
                    if j != k:
                        count_dict[s[i+l*k:i+l*k+l]] += 1
                        if count_dict[s[i+l*k:i+l*k+l]] > word_dict[s[i+l*k:i+l*k+l]]:
                            break
                    j += 1
                    k -= 1
                if count_dict == word_dict:
                    # first element = s[i + l * count]
                    if s[i + l * count:i + l * count + l] not in word_s:
                        break
                    index.append(i + l * count)
                    # gotta check the next word, if it exists
                    count_dict[s[i + l * count:i + l * count + l]] -= 1
                    count += 1
                    j = count + l_max - 1
                    k = j
                    if i+k+l > len(s) - 1:
                        break
        return index

    def findSubstring5(self, s, words):
        index = []
        total = len(s)
        l_max = len(words)
        l = len(words[0])
        word_dict = Counter(words)
        words_s = set(words)

        for i in range(l):
            count_dict = Counter()
            k = pos = i
            while k + l <= total:
                sub = s[k:k+l]
                if sub in words_s:
                    count_dict[sub] += 1
                    if count_dict == word_dict and k - pos == l_max * l - l:
                        index.append(pos)
                        count_dict[s[pos:pos + l]] -= 1
                        pos += l
                    elif count_dict[sub] > word_dict[sub] or k - pos == l_max * l - l:
                        count_dict[s[pos:pos + l]] -= 1
                        pos += l
                else:
                    count_dict.clear()
                    pos = k + l
                k += l

        return index


